            q = deque([x_0])

            dist = {x_0: 0}
            while q:
                x_i = q.popleft()

                if x_i > 0 and x_i - d in dist:
                    return dist[x_i - d] + 1

                if x_i < 0 and x_i + d in dist:
                    return dist[x_i + d] + 1

