class Solution:
    def brute_force(self, nums, m):
        """O(n^2) / O(1)"""
        n = len(nums)
        res = 0
        for l in range(n - 1):
            for r in range(l + 1, n):
                mid = (l + r) // 2
                if nums[mid] == m:
                    res += 1
        return res

    def solution(self, stdin: str) -> str:
        n, m = map(int, stdin.split())
        nums = list(map(int, stdin.split()))
        nums.sort()
        left, right = 0, n - 1
        while left < right:
            mid = (left + right) // 2
            if nums[mid] == m:
                left = mid + 1
            elif nums[mid] < m:
                left = mid + 1
            else:
                right = mid - 1
        res = 0
        if left == n - 1:
            res = 0
        else:
            if nums[left] == m:
                res = 1
            elif nums[left] > m:
                res = self.brute_force(nums, m)
        return str(res)

