"""
The plan:
This is a similar problem to 

Sudoku https://www.geeksforgeeks.org/sudoku-backtracking-7/

We represent the grid as a matrix (2D array).
We will loop over all the rows, looping over each column and then over the cells.

It is easy to check if a row, column or cell is full, by iterating over all the values and seeing if there is a duplicate.

This is the first step of the algorithm. Then we know that the first cell is free.

We can also quickly check if a column or cell is free by looking at the number of zeros in that column or row.

Now it's time for the "backtracking". We should look at the first empty cell in the grid. If we're at the end of the grid, we're done, and we can return the grid.

We can check if the cell is free by looking at the values of its row and column.
If we're at the end of the grid, we can return the grid. Otherwise, we can try out all possibilities for the next cell. If we don't find a valid combination, we can try out the next empty cell.

We know that the next cell must be in the same row as the previous one. So we know that if the previous cell is already filled, the next cell must also be filled in the same row.

We know that the next cell must be in the same column as the previous one. So we know that if the previous cell is already filled, the next cell must also be filled in the same column.

We can backtrack in the next cell.

We can try out all possibilities for the next cell, or we can try out a new possibility for the next row or next column.

We can check if the next cell is free by looking at its value.

If it is free, we can try out all possibilities for it.

If it is not free, then we know that we've come to the end of the grid. We can return the grid.

If there are no possible moves (no valid cell is free), then we have to backtrack to the previous cell and try a new one.

The algorithm ends if there is a solution.

"""

class Solution:
    def solve_sudoku(self, input):
        if not input:
            return input

        grid = self.parse(input)
        return self.solve(grid)

    def parse(self, input):
        grid = []
        for i in range(len(input)):
            row = []
            for j in range(len(input[0])):
                if input[i][j] == '*':
                    row.append(None)
                else:
                    row.append(int(input[i][j]))
            grid.append(row)
        return grid

    def solve(self, grid):
        if not grid:
            return grid

        row, col = self.find_next_empty(grid)
        if row == -1:
            return grid
        for i in range(1, 10):
            if self.is_valid(grid, row, col, i):
                grid[row][col] = i
                if self.solve(grid):
                    return grid
                grid[row][col] = 0
        return False

    def is_valid(self, grid, row, col, value):
        for i in range(len(grid)):
            if grid[row][i] == value:
                return False
            if grid[i][col] == value:
                return False
            if grid[3 * (row // 3) + i // 3][3 * (col // 3) + i % 3] == value:
                return False
        return True

    def find_next_empty(self, grid):
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 0:
                    return i, j
        return -1, -1

assert Solution().solve_sudoku("6 8\n....*...\n...**...\n..*****.\n...**...\n....*...\n........") == "3\n3 4 1\n3 5 2\n3 5 1"

