class Solution:
    def largestSumAfterKNegations(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        if not A:
            return 0
        neg_A = []
        for i in range(len(A)):
            if A[i] < 0:
                neg_A.append(-A[i])
        neg_A.sort()
        index = 0
        while K > 0 and index < len(neg_A):
            if neg_A[index] == 0:
                break
            if K % 2 == 0:
                A[index] = neg_A[index]
            else:
                A[index] = -A[index]
            K -= 1
            index += 1
        if K > 0:
            A.sort()
            while K > 0:
                A[-1] = -A[-1]
                K -= 1
        return sum(A)


