from typing import List

class Solution:
    def maxPoints(self, points: List[List[int]]) -> int:
        def cross(v1, v2):
            """
            Возвращает угол между двумя векторами
            Рассмотрим векторы v1 = (1, 2) и v2 = (2, 4):
            |v1| = sqrt(1^2 + 2^2) = sqrt(5) = 1.414...
            |v2| = sqrt(4^2 + 4^2) = sqrt(16) = 4.123...
            В результате получим дробное число (примерно 1.414...)
            """
            if v1[0] * v2[0] + v1[1] * v2[1] == 0:
                return 0
            return (v1[0] * v2[1] - v1[1] * v2[0]) / (v1[0] * v2[0] + v1[1] * v2[1])

        def find_polygon_angle(point: List[int], prev_point: List[int]):
            """
            Находим угол между двумя точками
            Варианты случаев:
            1. Если точки одного угла нет
            2. Если точки двух углов одинаковые, их необходимо исключить
            3. Если точки одного угла однозначно определить, то они всегда лежат в одной четверти от оси X или Y,
            и тогда необходимо исключить один из них
            """
            result = []
            for i in range(len(points)):
                if i == 0:
                    continue
                # Вычислим коэффициенты прямой
