                b = point[1] - k * point[0]
                if k == 0:
                    if b > 0:
                        result.append(math.pi / 2)
                    else:
                        result.append(3 * math.pi / 2)
                else:
                    if b > 0:
                        result.append(math.atan(k))
                    else:
                        result.append(math.atan(k) + math.pi)
            return result

        result = 0
        for i in range(len(points)):
            if i == 0:
                continue
            angle = find_polygon_angle(points[i], points[0])
            # Ищем самый маловероятный и запоминаем его как максимум
            max_angle = 0
            for angle_val in angle:
                if angle_val > max_angle:
                    max_angle = angle_val
            result = max(result, max_angle)
        return result

