                self.g[(int(line[1]), int(line[2]))] = set()
            if line[0] =='s':
                self.g[int(line[1])].add(self.c)
            self.c += 1
        for g in self.g:
            self.g[g].add(self.c)

    def make_tree(self, root: int, par: int = -1) -> dict:
        self.g[par].add(self.c)
        for c in self.g[root]:
            self.g[c] = self.g[root].union(self.g[par])
            self.make_tree(c, root)
        return self.g

    def sum_nodes(self, par: int = -1) -> int:
        if par in self.g:
            return sum(self.g[par])
        return 0

