from collections import namedtuple

Coordinate = namedtuple('Coordinate', ['x', 'y'])

class CookieCutter():

    def __init__(self, polygon: str, desired_area: int):
        self.polygon = polygon
        self.desired_area = desired_area
        self.corner_coordinates = self.parse_polygon()
        self.max_x = max(self.corner_coordinates, key=lambda c: c.x).x
        self.min_x = min(self.corner_coordinates, key=lambda c: c.x).x
        self.max_y = max(self.corner_coordinates, key=lambda c: c.y).y
        self.min_y = min(self.corner_coordinates, key=lambda c: c.y).y

    def parse_polygon(self):
        polygon = self.polygon.split('\n')
        point_coordinates = []
        for row in polygon[1:]:
            x, y = row.split(' ')
            point_coordinates.append(Coordinate(float(x), float(y)))
        return point_coordinates

    def shrink_polygon(self):
        shrunk_coordinates = []
        for i, c in enumerate(self.corner_coordinates):
            x, y = c.x, c.y
            shrunk_coordinates.append(Coordinate(x, y))

        for i, c in enumerate(shrunk_coordinates):
            c_x, c_y = c.x, c.y
            if c_x < self.min_x:
                shrunk_coordinates[i] = Coordinate(self.min_x, c_y)
            if c_y < self.min_y:
                shrunk_coordinates[i] = Coordinate(c_x, self.min_y)

        shrunk_coordinates.sort(key=lambda c: (c.x, c.y))
        return shrunk_coordinates

    def expand_polygon(self):
        expanded_coordinates = []
        for i, c in enumerate(self.shrunk_coordinates):
            c_x, c_y = c.x, c.y
            expanded_coordinates.append(Coordinate(c_x, c_y))

        for i, c in enumerate(expanded_coordinates):
            c_x, c_y = c.x, c.y
            if c_x > self.max_x:
                expanded_coordinates[i] = Coordinate(self.max_x, c_y)
            if c_y > self.max_y:
                expanded_coordinates[i] = Coordinate(c_x, self.max_y)

        expanded_coordinates.sort(key=lambda c: (c.x, c.y))
        return expanded_coordinates

    def get_relative_area(self, coordinates: list) -> int:
        deltas = []
        for i in range(len(coordinates) - 1):
            dx = coordinates[i + 1].x - coordinates[i].x
            dy = coordinates[i + 1].y - coordinates[i].y
            deltas.append(dx * dy)

        return sum(deltas)

    def adjust_polygon(self, coordinates: list):
        while True:
            relative_area = self.get_relative_area(coordinates)
            if relative_area == 0:
                return coordinates
            if relative_area < 0:
                coordinates = self.expand_polygon()
                continue
            if relative_area > self.desired_area:
                coordinates = self.shrink_polygon()
                continue

    def draw_polygon(self):
        x_points = []
        y_points = []
        for c in self.coordinates:
            x_points.append(c.x)
            y_points.append(c.y)

        return (x_points, y_points)

    def draw_cookie_cutter(self, coordinates: list):
        x_points, y_points = coordinates
        for x in x_points:
            print(f'{x:.6f}', end=' ')
        print()
        for y in y_points:
            print(f'{y:.6f}', end=' ')
        print()

    def get_solution(self):
        self.shrunk_coordinates = self.shrink_polygon()
        self.coordinates = self.adjust_polygon(self.shrunk_coordinates)
        solution = self.draw_polygon()
        return solution

