from itertools import product


class Grid:
    def __init__(self, grid):
        self.rows, self.columns = len(grid), len(grid[0])
        self.grid = grid
        self.max_num = 0

    def get_max_num(self):
        for row in self.grid:
            for num in row:
                if num > self.max_num:
                    self.max_num = num

    def __str__(self):
        return '\n'.join(''.join(row) for row in self.grid)

    def is_valid(self):
        return all([len(row) == self.columns for row in self.grid]) \
               and self.max_num == self.rows - 1

    def rotate(self):
        self.grid = [[row[j] for row in self.grid][::-1]
                    for j in range(self.columns)]

    def flip_horizontally(self):
        self.grid = [row[::-1] for row in self.grid]

    def get_adjacent_cells(self, cell):
        col, row = cell
        return [(col + i, row + j) for i, j in product([-1, 0, 1], [-1, 0, 1])
                if 0 <= col + i < self.columns
                and 0 <= row + j < self.rows
                and (i, j)!= (0, 0)]

    def is_valid_cell(self, cell):
        col, row = cell
        return (col, row) in self.get_all_cells()

    def get_all_cells(self):
        return set(product(range(self.columns), range(self.rows)))

    def place_coffee_shops(self):
        for cell in self.get_all_cells():
            if self.is_valid_cell(cell):
                self.grid[cell[1]][cell[0]] = 'E'

    def copy(self):
        return Grid([row[:] for row in self.grid])

