from __future__ import annotations
from copy import deepcopy
from typing import Optional
from math import sqrt


class Board:
    def __init__(self, n: int, grid: list[list[str]]) -> None:
        self.size = n
        self.grid = grid
        self.grid_copy = deepcopy(grid)
        self.grid_copy[self.grid.index("K")][self.grid[self.grid.index("K")].index("K")] = 1
        self.moves: dict[tuple[int, int], int] = {}
        self.solutions: list[list[int]] = []

    def move(self, r: int, c: int) -> None:
        cur_r, cur_c = self.grid.index("K"), self.grid[self.grid.index("K")].index("K")
        delta_r = r - cur_r
        delta_c = c - cur_c
        if delta_r > 0 and delta_c > 0:
            self.solutions.append(1)
        elif delta_r > 0 and delta_c < 0:
            self.solutions.append(2)
        elif delta_r < 0 and delta_c > 0:
            self.solutions.append(3)
        elif delta_r < 0 and delta_c < 0:
            self.solutions.append(4)

    def calculate_moves(self) -> None:
        for r in range(self.size):
            for c in range(self.size):
                if self.grid_copy[r][c] == 1:
                    continue
                r1, c1 = r + 2, c + 1
                r2, c2 = r + 2, c - 1
                r3, c3 = r - 2, c + 1
                r4, c4 = r - 2, c - 1
                r5, c5 = r + 1, c + 2
                r6, c6 = r + 1, c - 2
                r7, c7 = r - 1, c + 2
                r8, c8 = r - 1, c - 2
                if (r1, c1) not in self.moves and 1 <= r1 < self.size and 1 <= c1 < self.size:
                    self.moves[(r1, c1)] = self.moves[(r1, c1)] + 1 if (r1, c1) in self.moves else 1
                if (r2, c2) not in self.moves and 1 <= r2 < self.size and 1 <= c2 < self.size:
                    self.moves[(r2, c2)] = self.moves[(r2, c2)] + 1 if (r2, c2) in self.moves else 1
                if (r3, c3) not in self.moves and 1 <= r3 < self.size and 1 <= c3 < self.size:
                    self.moves[(r3, c3)] = self.moves[(r3, c3)] + 1 if (r3, c3) in self.moves else 1
                if (r4, c4) not in self.moves and 1 <= r4 < self.size and 1 <= c4 < self.size:
                    self.moves[(r4, c4)] = self.moves[(r4, c4)] + 1 if (r4, c4) in self.moves else 1
                if (r5, c5) not in self.moves and 1 <= r5 < self.size and 1 <= c5 < self.size:
                    self.moves[(r5, c5)] = self.moves[(r5, c5)] + 1 if (r5, c5) in self.moves else 1
                if (r6, c6) not in self.moves and 1 <= r6 < self.size and 1 <= c6 < self.size:
                    self.moves[(r6, c6)] = self.moves[(r6, c6)] + 1 if (r6, c6) in self.moves else 1
                if (r7, c7) not in self.moves and 1 <= r7 < self.size and 1 <= c7 < self.size:
                    self.moves[(r7, c7)] = self.moves[(r7, c7)] + 1 if (r7, c7) in self.moves else 1
                if (r8, c8) not in self.moves and 1 <= r8 < self.size and 1 <= c8 < self.size:
                    self.moves[(r8, c8)] = self.moves[(r8, c8)] + 1 if (r8, c8) in self.moves else 1

    def solve(self) -> Optional[int]:
        if self.grid[0][0] == "K":
            return 0

        if not self.moves:
            self.calculate_moves()

        if (1, 1) not in self.moves:
            return -1

        # (key, value) = (delta_r, delta_c, current_steps, min_steps)
        # In ascending order of (key, value)
        queue = [(-1, -1, 0, self.moves[(1, 1)])]

        while queue:
            delta_r, delta_c, cur_steps, min_steps = queue.pop(0)
            for r, c in [(delta_r + 2, delta_c + 1), (delta_r + 2, delta_c - 1), (delta_r - 2, delta_c + 1), (delta_r - 2, delta_c - 1), (delta_r + 1, delta_c + 2), (delta_r + 1, delta_c - 2), (delta_r - 1, delta_c + 2), (delta_r - 1, delta_c - 2)]:
                if (r, c) in self.moves and cur_steps + 1 < min_steps:
                    queue.append((r, c, cur_steps + 1, min_steps))

        if (1, 1) not in self.moves:
            return -1

        return self.moves[(1, 1)]

